zk.afterMount(function(){
      var images=["data:image/png;base64,",
				  "data:image/png;base64,",
				  "data:image/jpeg;base64,",
				  "data:image/png;base64,"];
      var i=0;
      var slideshow=zk.Widget.$('$slide');
      function nextImg(){
        slideshow.setSrc(images[i]);
        i=(i+1)%images.length;
      }
      setInterval(nextImg,2000);
});

